description:
Cryptonium is a new kind of decentralized currency. It is not minted or endorsed by countries/nations, but by users across the world. You can send and receive Cryptoniums from anywhere, only an internet connection is needed. Just 66 million Cryptoniums will ever exist. You can get Cryptoniums free of charge by mining or trade them trough an exchange service. The Cryptonium currency has been designed to develop steadily in the future, making it an ideal investment option.


